import React from "react";
import { View, ScrollView, Text } from "react-native";
import styled from "styled-components/native";
import {
  useSafeAreaInsets,
  SafeAreaView,
} from "react-native-safe-area-context";

const SafeCon = styled.SafeAreaView`
  width: 100%;
`;

const Con = styled.SafeAreaView`
  height: 100%;
  width: 100%;
`;

const ListCard = styled.ScrollView`
  height: 100%;
  width: 100%;
  background-color: aqua;
  padding: 15px;
`;

const Card = styled.ScrollView`
  height: 100%;
  width: 100%;
  height: 200px;
  border-bottom-width: 1px;
  width:100,
height:120,
shadowColor: '#000000',
    shadowOffset: {
      width: 0,
      height: 3
    },
    shadowRadius: 5,
    shadowOpacity: 1.0} 
}
`;

const HeaderLogo = styled.Text`
  font-size: 16px;
  color: black;
  padding: 15px;
`;

export { Con, HeaderLogo, SafeCon, ListCard, Card };
